
def RNAtoProtein(s):
	
	t = ""
	proteinDict ={'F':['UUU','UUC'],'L':['UUA','UUG','CUU','CUC','CUA','CUG'],'S':['UCU','UCC','UCA','UCG','AGU','AGC'],'Y':['UAU','UAC'], 'Stop':['UAA','UAG','UGA'],'C':['UGU','UGC'],'W':['UGG'],'P':['CCU','CCC','CCA','CCG'],'H':['CAU','CAC'],'Q':['CAA','CAG'],'R':['CGU','CGC','CGA','CGG','AGA','AGG',],'I':['AUU','AUC','AUA',],'M':['AUG'],'T':['ACU','ACC','ACA','ACG'],'N':['AAU','AAC'],'K':['AAA','AAG'],'V':['GUU','GUC','GUA','GUG'],'A':['GCU','GCC','GCA','GCG'],'D':['GAU','GAC'],'E':['GAA','GAG'],'G':['GGU','GGC','GGA','GGG']}
	stop = False
	for i in range(0,len(s),3):
		print(i)
		
		for key in proteinDict:
			#print(key)
			
			for n in range(0,len(proteinDict[key])):

				#print(proteinDict[key][n])
				if proteinDict[key][n] == s[i:i+3] and key != 'Stop':
					t = t+ key
					break
				elif proteinDict[key][n] == s[i:i+3] and key == 'Stop':
					stop = True

		if stop == True:
			break

		print(key)
		

	return t 

protString = RNAtoProtein('')
